import React, {Component, Fragment} from 'react';
import {BrowserRouter as Router} from 'react-router-dom';
import ToDoList from './ToDoList';
import NavBar from './NavBar';
import Data from '../Data'

class App  extends Component {
  constructor(props){
    super(props)
    this.state = {
      tasks: Data
    }
  }

  render(){
    return(
      <Router>
        <Fragment>
          <ToDoList />
          <NavBar />
        </Fragment>
      </Router>
    )
  }

}//end App class

export default App;
